import React,{ useEffect } from "react";
// import { Link } from "react-router-dom";

function Unity() {
    useEffect(() => {
        document.title = 'Unity';
    });
    return (
        <>
            <br/>
            <br/>
            <br/>
            <br/>
            <h1>Unity</h1>
        </>
    )
}

export default Unity
